import React, { Fragment } from "react";

const Classigication = () => {
  return (
    <Fragment>
      <Button
        variant="contained"
        fullWidth
        sx={{
          borderRadius: "0.5rem",
        }}
      >
        + New Classification
      </Button>
      {classification.map((data) => (
        <Box mt={1}>
          <List>
            <ListItem disablePadding>
              <ListItemText>{data.name}</ListItemText>
              <Button
                variant="contained"
                onClick={clsHandler(data.id)}
                sx={{
                  borderRadius: "0.5rem",
                  float: "right",
                }}
              >
                <ClearIcon />
              </Button>
            </ListItem>
          </List>
        </Box>
      ))}
    </Fragment>
  );
};

export default Classigication;
